INSERT INTO `review` VALUES
(1,1,5,'광주 영미오리탕이랑 맛차이는 거의 없음 \n들깨 듬뿍들어간 오리탕 먹으면서 \n술 곁들이면 진심 반칙임\n\n몸이 허헐땐 이만한 보양음식이 없음','2025-04-22'),
(2,1,5,'호남식 오리탕 전문점\n배달이 안되서 직접 가야하는 번거로움이 있는데 그만큼 값어치 있는 식당! 남녀노소 누구나 좋아하는 음식인듯!','2025-04-20'),
(3,1,5,'존맛. 또 먹고싶음 ..좀만 쌌어도 자주올텐데','2025-04-19'),
(4,1,5,'국물 미쳤다. 최고다\n술먹는 분위기 주김\n포장손님도 많았다','2025-04-11'),
(5,1,5,'국물 맛있음','2025-04-03'),
(6,2,5,'조개 맛있게 구워주시고 분위기가 따뜻해요 화장실 난로 같은 걸 보면 세심하게 신경쓰신 것 같아요 바로 옆에 공영주차장 있어서 주차 편리해요','2024-12-30'),
(7,2,5,'하 내 인생 조개찜 사랑해 웨이팅 지려도 기다릴게\n옛날도시락이랑 칼국수 추가 반드시 해야함ㅋ','2024-12-04'),
(8,2,5,'직원분들 친절 0티어예요\n맛있기도 엄청 맛있음','2024-05-27'),
(9,2,5,'사장 직원 다함께 열정적으로 즐겁게 일하시는 모습에 덩달아 기운도나고 조개구이 넘넘 맛있게 먹었습니다 !','2024-04-24'),
(10,2,5,'조개찜 이강주 칼국수 저세상 🤦‍♂️','2024-04-21'),
(11,3,5,'음식도 정갈하고 예쁘게 나와서 먹기 전부터 기분이 좋구요~보기만 예쁜게 아니라 먹었을 때도 너무 맛있었어요! 그리고 알바생분도 친절하시고 매장이 깔끔하고 혼밥하기 좋을 것 같아요!\n(밥과 카레가 1회 리필 가능한 점도 좋았습니다.)','2024-06-06'),
(12,3,5,'카레 너무 맛있어요 저는 최애카레집이라 친구들 이동네 오면 꼭 데려오고 친구들도 진심으로 만족합니다 ^^ 매장도 깔끔하고 너무 좋아요 ! 사장님 다른 리뷰들 보고 마음쓰지마세요 ❤️','2023-10-24'),
(13,3,5,'건대 쪽에 포장전문만 하실 때부터 이용했는데 항상 만족해요 :) 많이 버세용!','2022-05-21'),
(14,3,5,'넘 맛있고 마늘후레이크를 따로 주셔서 아주아주 좋아용!!!','2025-05-03'),
(15,3,5,'친절하시고 맛있어요💓💓','2025-04-06'),
(16,4,5,'족발 보쌈을 바로 썰어주셔서 뜨끈하게 나오고 맛도 좋았습니다.잡내 하나도 안나고 분위기도 좋아요','2024-09-21'),
(17,4,5,'한국 놀러와서 바로 옆집 이길래 와봤더니 너무 맛있고 사장님도 되게 친절하시더라구요 ㅠㅠ 보쌈 너무 맛있었어요!! 미국 다시 가기 전에 다시 들릴게요 ☺️','2024-08-27'),
(18,4,5,'독보적 분위기','2024-08-05'),
